import React from 'react';
import '../../css/home.css';

const Home = () => {
  return (
    <div class="content">
      <h1 class="title">SHAREHOME</h1>
      <p class="subtitle">
        A party game based on the hit Japanese reality TV show,
        <a href="http://www.terrace-house.jp/">Terrace House</a>.
        Become members and reenact your favorite scenes with friends!
      </p>
    </div>
  );
}

export default Home;
